import React from 'react'
import Logo from '../logo/logo';
import Container from 'react-bootstrap/Container';
import { FaBars } from "react-icons/fa";
import { connect } from 'react-redux';
import * as actions from '../../store/action/getData';
import { NavigationStyled } from './NavigationStyled';

const Navagations = React.memo(props => {
    // return (
    //     <NavigationStyled themeStyle={props.themeStyle}>
    //         <Container>
    //             <div className='content d-flex align-items-center justify-content-between'>
    //                 <Logo />
    //                 <div className='account_setting d-flex align-items-center' title={props.site_language && props.site_language.settings}>
    //                     <div className='setting' onClick={props.openAside}>
    //                         <FaBars size={30} />
    //                     </div>
    //                 </div>
    //             </div>
    //         </Container>
    //     </NavigationStyled>
    // )
    return props.site_language ? (
        <NavigationStyled themeStyle={props.themeStyle}>
            <Container>
                <div className='content d-flex align-items-center justify-content-between'>
                    <Logo />
                    <div className='account_setting d-flex align-items-center' title={props.site_language.settings}>
                        <div className='setting' onClick={props.openAside}>
                            <FaBars size={30} />
                        </div>
                    </div>
                </div>
            </Container>
        </NavigationStyled>
    ) : null;
}, []);

const mapStateToProps = state => ({
    themeStyle: state.themeStyle,
    site_language: state.site_language
});

const mapDispatchToProps = dispatch => ({
    openAside: () => dispatch(actions.openAside())
});

export default connect(mapStateToProps, mapDispatchToProps)(Navagations);
